import styled from 'styled-components';
import Header from '../components/Header';

const Layout = styled.div`
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: 200px 1fr 200px;
`;

const HomePage = () => {
  return (
    <Layout>
      <Header />
      <main>메인</main>
      <footer>푸터</footer>
    </Layout>
  );
};

export default HomePage;
